import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import { NavLink } from "react-router-dom";
import Logo from "../logo.png";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  navSpace: {
    padding: theme.spacing(2),
    textAlign: "center"
  },
  bar: {
    [theme.breakpoints.down("sm")]: {
      background: "#ee1515!important"
    }
  },
  nl: {
    color: "#f0f0f0",
    textDecoration: "none",
    textTransform: "uppercase",
    letterSpacing: theme.spacing(0.5)
  },
  logo: {
    paddingTop: theme.spacing(1.375),
    width: "20%",
    marginRight: theme.spacing(2)
  }
}));

export default function ButtonAppBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar color="default" className={classes.bar} position="static">
        <Toolbar disableGutters={true}>
          <Grid container>
            <Grid item={true} md={2} xs={12}>
              <IconButton
                edge="start"
                className={classes.menuButton}
                color="inherit"
                aria-label="menu"
              >
                <MenuIcon />
              </IconButton>
            </Grid>
            <Grid item={true} md={2} xs={12}>
              <Typography variant="h6" className={classes.navSpace}>
                <NavLink to="/PokeList" className={classes.nl}>
                  PokeList
                </NavLink>
              </Typography>
            </Grid>
            <Grid item={true} md={2} xs={12}>
              <Typography variant="h6" className={classes.navSpace}>
                <NavLink to="/Type" className={classes.nl}>
                  By Type
                </NavLink>
              </Typography>
            </Grid>
            <Grid
              item={true}
              md={8}
              xs={12}
              className={classes.navSpace}
              style={{ padding: 0, textAlign: "right" }}
            >
              <img src={Logo} alt="PokeFind" className={classes.logo} />
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
}
